import math
from decimal import Decimal


def get_decimal(binary_str):
    i = len(binary_str)-1
    place = 0
    sum = 0
    while i >= 0:
        sum = sum + int(Decimal(int(binary_str[i]) * (2 ** place)))
        place = place + 1
        i = i - 1
    return int(sum)


def get_binary(decimal):
    remainder_str = ""
    flag = True
    while flag:
        if decimal % 2 == 0:
            remainder_str = "0"+remainder_str
            decimal = decimal//2
        else:
            remainder_str = "1"+remainder_str
            decimal = (decimal-1)//2
        if decimal == 0:
            flag = False
    return remainder_str


class Solution:
    def addBinary(self, a: str, b: str) -> str:
        a_decimal = get_decimal(a)
        b_decimal = get_decimal(b)
        sum = a_decimal + b_decimal
        binary_sum = get_binary(sum)
        return binary_sum



ins = Solution()
call = ins.addBinary("",
                     "1")
print("call: ", call)

